CREATE DEFINER=`root`@`localhost` PROCEDURE `CalculateSomme` (IN `rental_id` INT, OUT `somme` DECIMAL(10,2))   BEGIN
  DECLARE start_date DATE;
  DECLARE end_date DATE;
  DECLARE price DECIMAL(10, 2);

  SELECT start_date, end_date, price
  FROM rental
  JOIN caftan ON rental.item_id = caftan.item_id
  WHERE rental_id = rental_id
  INTO start_date, end_date, price;

  SET somme = DATEDIFF(end_date, start_date) * price;
END$$

